/* eslint-disable jsx-a11y/iframe-has-title */
import React from "react";
import { Link } from "react-router-dom";
import { Table, CardBody, CardTitle, Col, Row } from "reactstrap";
import { index } from "../../../config/pluginsInit";
import data from '../../../fakeData/json/sampledata.json';

class Index extends React.Component {
     
    componentDidMount() {
        setTimeout(function () {
            index();
        }, 800);
    }

    render() {
        return (
            <>

<Table hover className="table" items={data.data}>
   <thead>
      <tr>
         <th scope="col">#</th>
         <th scope="col">Name</th>
         <th scope="col">Address</th>
         <th scope="col"></th>
         
      </tr>
   </thead>
   <tbody>
                                {
                                    data.data.map((item, index) => (
                                       
                                        <tr key={index}>
                                            <td >{item.refnum} </td>
                                            <Link   to={item.link} className="nav-link font-weight-bold search-box-toggle">{item.description} </Link>
                                            <td >{item.street}   {item.Apartment} {item.doornum} {item.region} {item.country}</td>
                                            <Link>Delete</Link>
                                        </tr>
                                    ))
                                }


   </tbody>
</Table>

             
            </>
        )
    }
}

export default Index;
